import * as types from "../types";
import moment from "moment";
const initalState = {
  FirstName: "",
  LastName: "",
  SSID: "",
  BirdDay: moment().format("MMM Do YY"),
  PostId: "",
  time: 0,
  loadding: false,
  error: null,
};
export const postReducer = (state = initalState, action) => {
  switch (action.type) {
    case types.UPDATE_FIRSTNAME:
      return {
        ...state,
        FirstName: action.payload,
      };
    case types.UPDATE_LASTNAME:
      return {
        ...state,
        LastName: action.payload,
      };
    case types.UPDATE_SSID:
      return {
        ...state,
        SSID: action.payload,
      };
    case types.UPDATE_BIRD:
      return {
        ...state,
        BirdDay: moment(action.payload).format("MMM Do YY"),
      };
    case types.UPDATE_POST:
      return {
        ...state,
        PostId: action.payload,
      };
    case type.UPDATE_TIME:
      return {
        ...state,
        time: action.payload,
      };
    default:
      return state;
  }
};
